import React from 'react';
import Navbar from './components/Navbar';
import ProductList from './components/ProductList';
import { Container, Box } from '@mui/material';

const App = () => (
  <>
    <Navbar />
    <Container>
      <Box sx={{ my: 4 }}>
        <ProductList />
      </Box>
    </Container>
  </>
);

export default App;
